{'total': 1, 'items': [{'title': 'Investigacion "Lineamientos Metodológicos de Informes Periciales en Tribunales de Familia"', 'description': 'Esta investigación surgió desde la  evidencia respecto a las debilidades que hoy existen en el que hacer pericial, entendiendo por debilidades:
1) la ambigüedad de la ley; 
2) la falta de claridad de todos los intervinientes respecto a cuales son las  metodologías adecuadas  que pueden utilizar los  profesionales peritos, 
3) así como la falta de lineamientos éticos y calificación profesional de quienes ejercen esta labor.

Las consecuencias de éstas falencias  en el ejercicio de impartir justicia, se han manifestado en el  descontento de  los actores que participan en los procedimientos judiciales  (familias, niños - niñas y adolescentes; jueces, abogados y consejeros técnicos), toda vez que los jueces requieren de evaluaciones periciales de excelencia para resolver, por otra parte  las familias, niños, niñas y adolescentes necesitan ser  evaluados por un experto que contribuya en la mejor resolución del conflicto familiar, lo que no siempre ocurre en la práctica.   
